    console.log("call SelectAll");
    
    if (props.setting==='all') {
        const proplist = props.todoArr;
        const listItems = proplist.map( (item) =>
        <li> {item.item} </li>
        )
        return(
            <div>
                <p> <b> All: </b> </p>   
                {listItems}
            </div >
        );
    }
    else { return (
                   null)
    }
};
export default SelectAll;
